import React from 'react';
import toDoData from './toDoData';
import ToDo from './ToDo';

function App(){
  const components=toDoData.map((item)=>{
                                return <ToDo item={item}/>
                                });

  return(
  <div>
    {components}
  </div>
  );
}

export default App;
